  return (
    <div className="App">
      <div className="App-header">
        <NavBar />
        <div style={{color:"black"}}>
          <h1 style={{background:"	#F0F8FF", borderRadius:"0.80em"}}>Welcome to my Photojournal</h1>
        </div>

        <SearchBar />

     </div>
     <div style={{fontSize:"2em"}}><h2>This is the my story</h2></div>       
      <div>
        <AlbumMaker />
        <div>&copy; 2022</div>  
      </div>

    </div>
  );
}

export default App;
